import './Chessboard.css';
import { Pawn } from '../pieces/Pawn';
import { Rook } from '../pieces/Rook';
import { PieceModel } from '../../../../model/PieceModel';
import { SquareModel } from '../../../../model/SquareModel';

export default function Square(props: {color:string, pos:string, piece:PieceModel | undefined}){
    const squareModel:SquareModel = new SquareModel(props.color,props.pos,props.piece);
    let pieceView = undefined;
    if(props.piece?.getType() == "Pawn"){
        pieceView = <Pawn type="Pawn" color={props.piece.getColor()}></Pawn>
    }
    else if(props.piece?.getType() == "Rook"){
        return <Rook type="Rook" color={props.piece.getColor()}></Rook>
    }
    return (<div className={props.color+"Square"} id={props.pos}>
                {pieceView}
            </div>);
}
